import React, { useState, useEffect } from "react";
import axios from "axios";
import "./DoctorProfile.css";

const DoctorProfile = ({ loggedInEmail }) => {
  const [profileData, setProfileData] = useState(null);
  const [isEmailChecked, setIsEmailChecked] = useState(false);
  const [userId, setUserId] = useState(null);
  const [loading, setLoading] = useState(true);
  const [formData, setFormData] = useState({
    doctorId: "",
    doctorName: "",
    speciality: "",
    location: "",
    mobileNo: "",
    email: loggedInEmail || "",
    experience: "",
    password: "",
  });

  // Check email and fetch data if loggedInEmail is provided
  useEffect(() => {
    if (loggedInEmail) {
      checkEmail(loggedInEmail);
    } else {
      setLoading(false);
    }
  }, [loggedInEmail]);

  const checkEmail = async (email) => {
    try {
      setLoading(true);
      const response = await axios.get(`http://localhost:8000/doctor/getDoctorByEmail?email=${email}`);
      if (response.data.doctorProfile) {
        setProfileData(response.data.doctorProfile);
        setFormData(response.data.doctorProfile); // Pre-fill form with fetched data
      } else if (response.data.userId) {
        console.log("User ID (for new profile creation):", response.data.userId);
        setUserId(response.data.userId);
      } else {
        console.warn("No doctor profile or userId found for the given email.");
        setProfileData(null);
        setUserId(null);
      }
    } catch (error) {
      console.error("Error checking email or fetching data:", error);
    } finally {
      setLoading(false);
      setIsEmailChecked(true);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:8000/doctor/addDoctor", {
        ...formData,
        userId, // Include userId if available
      });
      alert("Profile saved successfully!");
      setProfileData(response.data); // Update profile data after saving
    } catch (error) {
      console.error("Error saving profile:", error);
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="doctorProfile">
      {profileData ? (
        <div>
          <h3>Doctor Profile</h3>
          <p><strong>Name:</strong> {profileData.doctorName}</p>
          <p><strong>Specialization:</strong> {profileData.speciality}</p>
          <p><strong>Doctor ID:</strong> {profileData.doctorId}</p>
          <p><strong>Location:</strong> {profileData.location}</p>
          <p><strong>Mobile No:</strong> {profileData.mobileNo}</p>
          <p><strong>Email:</strong> {profileData.email}</p>
          <p><strong>Experience:</strong> {profileData.experience}</p>
        </div>
      ) : (
        <div>
          {u ? (
            <>
              <h2>Create Doctor Profile</h2>
              <form onSubmit={handleSubmit}>
                <input
                  name="doctorName"
                  placeholder="Name"
                  value={formData.doctorName}
                  onChange={handleChange}
                  required
                />
                <input
                  name="doctorId"
                  placeholder="Doctor ID"
                  value={formData.doctorId}
                  onChange={handleChange}
                  required
                />
                <input
                  name="speciality"
                  placeholder="Specialization"
                  value={formData.speciality}
                  onChange={handleChange}
                  required
                />
                <input
                  name="location"
                  placeholder="Location"
                  value={formData.location}
                  onChange={handleChange}
                  required
                />
                <input
                  name="mobileNo"
                  placeholder="Mobile No"
                  value={formData.mobileNo}
                  onChange={handleChange}
                  required
                />
                <input
                  name="email"
                  placeholder="Email"
                  value={formData.email}
                  onChange={handleChange}
                  readOnly
                />
                <input
                  name="experience"
                  placeholder="Experience"
                  value={formData.experience}
                  onChange={handleChange}
                  required
                />
                <input
                  type="password"
                  name="password"
                  placeholder="Password"
                  value={formData.password}
                  onChange={handleChange}
                  required
                />
                <button type="submit">Save Profile</button>
              </form>
            </>
          ) : (
            <div>
              <h2>Email not associated with a profile or user.</h2>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default DoctorProfile;
